import React from 'react';
import styled from 'styled-components';
import Text from './TextComponent'
import GroupRadio from './GroupRadioComponent';

const Container = () => {

const StyledContainer = styled.div`
  font-family: Roboto,Arial,sans-serif;
  display: flex;
  flex-flow: row;
  height: 500px;
  width: 800px;
  margin: 60px 20%;
  padding: 0;
  text-align:left;
`;

const TextContainer = styled.div`
  width: 40%;
  height: auto;
  padding: 100px 0px 0px 0px;
`;

const GroupContainer = styled.div`
  border: solid 1px #8D7AFF;
  padding: 60px 0px 0px 60px;
  width: 60%;
  height: auto;
`;

  return (
    <StyledContainer>
      <TextContainer>
        <Text color="#8D7AFF" size="16px" value='Identidad' />
        <Text color="#8D7AFF" size="16px" value='Propietario' />
        <Text color="#8D7AFF" size="24px" value='CaracterÃ­sticas basicas' bold/>
        <Text color="#696969" size="16px" value='Espacios' />
        <Text color="#696969" size="16px" value='Fotos y anuncio' />
        <Text color="#696969" size="16px" value='Precio' />
        <Text color="#696969" size="16px" value='Disponibilidad' />
      </TextContainer>
      <GroupContainer>
        <Text color="#696969" size="20px" value='Tipo de propiedad' />
        <GroupRadio value='Departamento' />
        <GroupRadio value='Estudio' />
        <GroupRadio value='Loft' />
        <GroupRadio value='Casa' />
        <GroupRadio value='Duplex' />
      </GroupContainer>
    </StyledContainer>
  );
}

export default Container;
